import { FaGlobeAmericas } from "react-icons/fa";
import { ImConnection, ImUsers } from "react-icons/im";
import { NavLink as Link } from "react-router-dom";
import { AuthContext } from "../Contexts/AuthContext";

export default function Header() {
  const { logout } = useContext(AuthContext);

  return (
    <header>
      <div
        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
          height: "100%",
        }}
      >
        <Link
          className="navButton"
          exact
          to="/news"
          activeClassName={"navButton-active"}
        >
          <ImConnection />
        </Link>
        <Link
          className="navButton"
          exact
          to="/blogs"
          activeClassName={"navButton-active"}
        >
          <ImUsers />
        </Link>
      </div>
      <div>Limhamn Sj√∂stad</div>
