        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-end",
        }}
      >
        <input type="search" />
        <div className="navButton" onClick={() => logout()}>
          <FaGlobeAmericas />
        </div>
      </div>
    </header>
  );
}
